import React from "react";
import { AiOutlineSearch } from "react-icons/ai";
const Input = ({ handle, search }) => {
  return (
    <form>
      <AiOutlineSearch />
      <input
        onChange={handle}
        type="text"
        name="movie"
        placeholder="Search for a Movie"
        onKeyPress={search}
      />
    </form>
  );
};

export default Input;
